import React, { Component } from 'react';

export default class Social extends Component {
    render() {
        return (
            <article className="Contact" id="mySocial">
                <a href="https://www.facebook.com/christophe.demey.7" target="_blank"><i class="fab fa-facebook-square fa-4x"></i></a>
                <a href="https://www.linkedin.com/in/christophe-demey/" target="_blank"><i class="fab fa-linkedin fa-4x"></i></a>
                <a href="https://github.com/ChrisDemey" target="_blank"><i class="fab fa-github-square fa-4x"></i></a>
                <a data-aos="fade-up" data-aos-duration="600" href="https://codepen.io/chrisdemey" target="_blank"><i class="fab fa-codepen fa-4x"></i></a>
                <a data-aos="fade-up" data-aos-duration="600" href="https://twitter.com/DemeyChristophe" target="_blank"><i class="fab fa-twitter-square fa-4x"></i></a>
                <a data-aos="fade-up" data-aos-duration="600" href="mailto:demey.christophe.dc@gmail.com" target="_blank"><i class="fas fa-envelope-square fa-4x"></i></a>
            </article>
        );
    }
}
